import React, { useState } from "react";
import { View, Text, StyleSheet, Image } from "react-native";

const Configuration = () => {
    const estadistica = "https://img.freepik.com/foto-gratis/mujer-hermosa-joven-mirando-camara-chica-moda-verano-casual-camiseta-blanca-pantalones-cortos-hembra-positiva-muestra-emociones-faciales-modelo-divertido-aislado-amarillo_158538-15796.jpg?w=740&t=st=1687478336~exp=1687478936~hmac=e9b9dfc516a8ad195be37d0fe743165b3458884be588bf766b38d5f34d3c4e60";

    return (
        <View style={styles.container}>
            <Image source={{ uri: estadistica }} style={styles.estad} />
            <View >

                <Text >
                    ESTADISTICAS
                </Text>
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        width: "50%",
        alignItems: 'center'
    },
    
    estad: {
        alignItems: 'center',
        marginTop: -75
    },
})

export default Configuration;
